import React, { Component } from "react";
import Form from "../components/forms";
import { Link } from "react-router-dom";
import { FaHome } from "react-icons/fa";

class Reservar extends Component {
  render() {
    return (
      <section id="Registrar" className="py-10 px-3 bg-amber-300 min-h-screen min-w-screen sm:flex sm:justify-center sm:items-center">
        <div className="bg-gray-700 px-9 rounded-2xl py-5 h-full items-center">
          <div className="flex-row block w-full h-full ">
            <h2 className="text-center pb-7 text-white">Realizar Reserva</h2>
            <Link className="text-white flex justify-center items-center pb-2"><FaHome/></Link>
            <div className= "">
              <Form />
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default Reservar;
